import React, { useState } from 'react';
import './styles/App.css';
import MyButton from './components/UI/button/MyButton';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import MainPage from './components/Pages/MainPage';
import BurgerMenu from './components/Pages/BurgerMenu';
import routes from './routes';

function App() {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <BrowserRouter>
      <div className="App">
        <BurgerMenu isOpen={menuOpen} toggleMenu={toggleMenu} />
        <div className={`navigation ${menuOpen ? 'open' : ''}`}>
          <Link to="/main" className="linkButton">
            <MyButton onClick={toggleMenu}>Главная</MyButton>
          </Link>
          <Link to="/biography" className="linkButton">
            <MyButton onClick={toggleMenu}>Биография</MyButton>
          </Link>
          <Link to="/portfolio" className="linkButton">
            <MyButton onClick={toggleMenu}>Портфолио</MyButton>
          </Link>
          <Link to="/resume" className="linkButton">
            <MyButton onClick={toggleMenu}>Резюме</MyButton>
          </Link>
          <Link to="/video" className="linkButton">
            <MyButton onClick={toggleMenu}>Видео</MyButton>
          </Link>
          <Link to="/contacts" className="linkButton">
            <MyButton onClick={toggleMenu}>Контакты</MyButton>
          </Link>
        </div>
        <Routes>
          {routes.map(({ path, component }, index) => (
            <Route key={index} path={path} element={component} />
          ))}
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
